import React from 'react';
import todoData from './todosData'
import TodoItem from './components/TodoItem'

class App extends React.Component {
  constructor() {
    super()
    this.state = {
      todos: todoData
    }
  }
  render() {
    //let todoList = this.state.todos.map(item => {

    // })
    return (
      <div>
        <TodoItem item={this.state.todos} />
      </div>
    )
  }
}

export default App;
